import React from "react";
import styled from "styled-components";

const Box = styled.div`
    .name_area {
        font-size: 2rem;
        border: thick double black;
        border-radius: 2px;
    }
    .infor {
        font-size: 1.5rem;
        border: thick black;
        border-radius: 2px;
    }
    & + & {
        margin-top: 10px;
    }
`;

function PostCard() {
    return (
        <>
            <Box>
                <div className="name_area">name_area</div>
                <div className="infor">infor</div>
            </Box>
        </>
    );
}

export default PostCard;
